script: |
  super -f text -I q10832.spq | sort > q10832.out

inputs:
  - name: q10832.spq
    data: |
      SELECT col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 / 46 NOT BETWEEN ( + col2 + - 82 + - 46 ) AND ( + col1 * col1 );
  - name: tab2

outputs:
  - name: q10832.out
    data: |
      51
      67
      77
